  false,\n\t\"url\": null,\n\t\"notes\": \"The For-Hire Vehicle (u201cFHVu201d) trip
  records include fields capturing the dispatching base license number and the pick-up
  date, time, and taxi zone location ID (shape file below). These records are generated
  from the FHV Trip Record submissions made by bases. Note: The TLC publishes base
  trip record data as submitted by the bases, and we cannot guarantee or confirm their
  accuracy or completeness. Therefore, this may not represent the total amount of
  trips dispatched by all TLC-licensed bases. The TLC performs routine reviews of
  the records and takes enforcement actions when necessary to ensure, to the extent
  possible, complete and accurate information.rnrnFor trip record data including TLC
  taxi zone location IDs, location names and corresponding boroughs for each ID can
  be found <a href=\"https://s3.amazonaws.com/nyc-tlc/misc/taxi+_zone_lookup.csv\">here</a>.
  A shapefile containing the boundaries for the taxi zones can be found <a href=\"https://s3.amazonaws.com/nyc-tlc/misc/taxi_zones.zip\">here</a>.\",\n\t\"license_title\":
